css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("paco.ua.pt") {

.item_menu_selected{
border: 0px !important;
background-color: #e9f7d8 !important;
}

a {
color: #527528 !important;
text-decoration: none !important;
font-weight: bold !important;
}
a:hover {
color: #324e11 !important;
text-decoration: none !important;
font-weight: bold !important;
}
.table_topcol, td[bgcolor="#800000"]{
background-color: #999999 !important;
}

.table_footer{
background-color: #e3e3e3 !important;
border: 0px solid #dadada !important;
}
table[bgcolor="#FFCC99"], .table_cell_impar{
background-color: white !important;
}
td[bgcolor="#FFFFE1"]{
background-color: #f1f1f1 !important;
}
td[width="21"]{
background-image: none !important;
}
.table_cell, td[bgcolor="#FFEBD7"], td[bgcolor="#FFF9F2"], .table_line_value{
background-color: #f1f1f1 !important;
}
.table_head{
background-color: #dadada !important;
} 
td[bgcolor="#FFF5EC"]{
background-color: white !important;
border-bottom: 1px solid #e3e3e3 !important;
}
td[bgcolor="#FFCC99"], .table_cell_par, .table_line_caption{
background-color: #e3e3e3 !important;

}
h1{
color: #777777 !important;
}
h2,h3,h4{
color: #888888 !important;
}
font[color="#F4E7CE"]{
color: white !important;
}
font[color="#800000"], font[color="brown"]{
color: #999999 !important;
}
td[colspan="3"]{
padding:0px !important;
}
td[bgcolor="#FF9966"], #divInformacaoTimeout{
background-color: white !important;
padding: 4px !important;
}

img[src="/common/images/printer_small.gif"]{
width: 0px !important;
height: 0px !important;
padding-right: 22px !important;
padding-bottom: 16px !important;
background: url(data:image/png;base64,%3D
) !important;
}
img[src="/common/images/top.gif"]{
width: 0px !important;
height: 0px !important;
padding-right: 24px !important;
padding-bottom: 16px !important;
background: url(data:image/png;base64,%3D%3D
) !important;
}
img[src="/common/images/close.gif"]{
width: 0px !important;
height: 0px !important;
padding-right: 24px !important;
padding-bottom: 16px !important;
background: url(data:image/png;base64,%3D%3D
) !important;
}
#template_menu{
background-color: white !important;
}
.toolbox_up {
background-color: #8fb85f !important;
border-top: 0px solid #a3cf6e !important;
border-bottom: 1px solid white !important;
border-left: 1px solid white !important;
border-right: 0px solid #a3cf6e !important;
color: white !important;
font-weight:bold !important;
}
.toolbox_down {
background-color: #6c9040 !important;
border-top: 0px solid #a3cf6e !important;
border-bottom: 1px solid white !important;
border-left: 1px solid white !important;
border-right: 0px solid #a3cf6e !important;
color: white !important;
font-weight:bold !important;
}
.menu{
color: #333333 !important;
font-weight: normal !important;
}
.item_menu{
background-color: #d7f1b8 !important;
border-top: 0px solid #a3cf6e !important;
border-bottom: 1px solid white !important;
border-left: 0px solid #a3cf6e !important;
border-right: 0px solid #a3cf6e !important;
}
.item_menu_over{
background-color: #c3e1a0 !important;
border-top: 0px solid #a3cf6e !important;
border-bottom: 1px solid white !important;
border-left: 0px solid #a3cf6e !important;
border-right: 0px solid #a3cf6e !important;
}
.table_header, td[bgcolor="#006666"]{
background-color: #a3cf6e !important;
padding: 8px 14px 8px 14px !important;
border-top: 0px solid #a3cf6e !important;
border-bottom: 1px solid white !important;
border-left: 0px solid #a3cf6e !important;
border-right: 0px solid #a3cf6e !important;
}
.rodape{
font-size: 9px !important;
background-color: #a3cf6e !important;

border-top: 0px solid #a3cf6e !important;
border-bottom: 1px solid white !important;
border-left: 0px solid #a3cf6e !important;
border-right: 0px solid #a3cf6e !important;
}
table[width="750"], table[width="750px"],table[width="468"]{
width: 95% !important;
margin-left:auto !important;
margin-right:auto !important;
}
table[width="150"]{
width: 100% !important;
}
img[src="/common/images/template/header_secvirtual.jpg"], 
img[src="/common/images/template/header_disciplinas.jpg"],
img[src="/common/images/template/header.jpg"],
img[src="/common/images/template/header_horarios.jpg"]
{
width: 0px !important;
height: 0px !important;
padding-right: 430px !important;
padding-bottom: 60px !important;
background: url(data:image/gif;base64,%3D

) !important;
}





}
